import React from 'react';

const MenuPage = ({ categories, showProducts, goBack }) => {
  return (
    <div>
      <h1>Menu</h1>
      <div className="categories-container">
        {categories.map(category => (
          <button key={category} onClick={() => showProducts(category)} className="category-button">
            {category}
          </button>
        ))}
      </div>
      <button onClick={goBack}>Back to Landing Page</button>
    </div>
  );
};

export default MenuPage;
